import React, { Component, useMemo } from 'react'

const GuideTable = (props) => {
  console.log(props)

  const columns = [ 'envio', 'rastreo', 'status', 'destinatario', 'total', '', '' ]

  const data = props.userGuides
  console.log(data)

  // const data = [
  //   { envio: '12374693', rastreo: '18327474391', status: 'En camino', destinatario: 'Monte Palatino 212', total: '500.50' },
  //   { envio: '222222222', rastreo: '18327474391', status: 'Entregado', destinatario: 'Monte Palatino 212', total: '500.50' },
  //   { envio: '333333333', rastreo: '18327474391', status: 'Cancelado', destinatario: 'Monte Palatino 212', total: '500.50' },
  //   { envio: '333333333', rastreo: '18327474391', status: 'Cancelado', destinatario: 'Monte Palatino 212', total: '500.50' },
  //   { envio: '333333333', rastreo: '18327474391', status: 'Cancelado', destinatario: 'Monte Palatino 212', total: '500.50' }
  // ]

  const renderRow = (guide, index) => {
    return (
      <tr key={index}>
        <td>{guide.envio}</td>
        <td>{guide.rastreo}</td>
        <td>{guide.status}</td>
        <td>{guide.destinatario}</td>
        <td>{guide.total}</td>
        <td><button>Descargar</button></td>
      </tr>
    )
  }; 

  return (
    <div>
      <table>
        <thead>
          <th>Envio</th>
          <th>Rastreo</th>
          <th>Estatus</th>
          <th>Destinatario</th>
          <th>Total</th>
          <th>Acciones</th>
        </thead>
        <tbody>
          {data.map(renderRow)}
        </tbody>
      </table>
    </div>
  )
}

export default GuideTable;
